import { createApp } from 'vue'
import App from './App.vue'
import 'semantic-ui-css/semantic.min.css';
import SuiVue from 'semantic-ui-vue';
Vue.use(SuiVue);

Vue.use(SuiVue);

new Vue({
  render: h => h(App),
}).$mount('#app');


createApp(App).mount('#app')
